import React from "react";
import {
  useGetData,
  //   usePostData,
  //   useEditData,
  //   useDeleteData,
} from "../../../axios/hooks";
import EditProduct from "../EditProduct/editProduct";
import PostProduct from "../PostProduct/postProduct";

export default function GetProduct() {
  const {
    data: products,
    isLoading,
    isError,
  } = useGetData(["products"], `/products`);
  console.log(products?.data[0]);

  if (isLoading) {
    return <p>is Loading</p>;
  }
  return (
    <div>
      <h1>sdfa</h1>
      <PostProduct />
      <EditProduct />

      {products?.data?.map((e) => {
        return (
          <div key={e.id}>
            <div>
              <h4>{e.id}</h4>
              <p>{e.gender}</p>
              <p>{e.name_Ru}</p>
              <p>{e.description_Ru}</p>
              <p>{}</p>
              {console.log(e)}
            </div>
          </div>
        );
      })}
    </div>
  );
}
